import React from "react";
import eu from "../assets/eu.png";

const About = () => {
  return (
    <section id="about">
      <h2>Sobre Mim</h2>
      <div className="sobre-container-teste">
        <div className="sobre-texto">
        <p>
        Olá me chamo Patrick Macêdo Felicio sou Tecnico em Informática e atualmente curso Analise e Desenvolvimento de Sistemas. Nasci e moro na cudade de Ji-Paraná do estado de Rondônia. Atualmente estou trabalhando na área de Suporte de Banco de Dados da cooperativa CrediSIS Central.
        </p>
        </div>
        <div className="sobre-imagem">
            <img src={eu} alt="Minha Foto" />
         </div>
        </div>
    </section>
  );
};

export default About;
